// 解析藏寶圖數據
const TREASURES = TREASURES_RAW.split("|").map(row => {
    const [id, x, y, map, partySize, item] = row.split(",");
    return {
        id,
        coords: { x: parseFloat(x), y: parseFloat(y) },
        map: parseInt(map),
        partySize: parseInt(partySize),
        item: parseInt(item)
    };
});

// 輔助函數：獲取地圖名稱
function getMapName(mapId) {
    const map = MAP_DATA[mapId];
    if (map) {
        return PLACE_NAMES[map.placename_id] || `地圖 ${mapId}`;
    }
    return `地圖 ${mapId}`;
}

// 輔助函數：獲取物品名稱
function getItemName(itemId) {
    return ITEM_NAMES[itemId] || `物品 ${itemId}`;
}
